% (1) Based on Atteia et al (https://doi.org/10.1074/jbc.M507862200) CR5 -
% Pyruvate Formate Lyase has never been detected in plants nor animals. The
% oxaloacetate for lipid synthesis is provided by ATP-citrate lyase in
% cytoplasm
% (2) Complex II (FAD-based) of the mitochondria seems to be inactivated.
% This is supported by Peters (2012) (DOI 10.1007/s11103-012-9911-4)
% 
function [model_lettuce, reactionNames, reactionFormulas, SubSystems] = LettuceMetabolicModel(hour)
